import React from "react";
import { BrowserRouter } from 'react-router-dom/cjs/react-router-dom.min';
import './App.css';
import Routes from './Routes/Routes';
import NavBar from './Nav/NavBar';

function App() {
  return (
    <BrowserRouter>
      <NavBar />
      <Routes />
    </BrowserRouter>
  );
}

export default App;
